prompt Creating AppCRM schema owner user with noauth
create user AppCRM no authentication quota 10M on users;

prompt Moving to that schema...
alter session set current_schema=AppCRM;

prompt Create crm_customer table
create table crm_customer (
    customerid                     number generated by default on null as identity 
                                   constraint crm_customer_customerid_pk primary key,
    first_name                     varchar2(25),
    last_name                      varchar2(35),
    gender                         varchar2(30) constraint crm_customer_gender_cc
                                   check (gender in ('MALE','FEMALE')),
    email                          varchar2(35),
    phone_mobile                   number,
    active                         varchar2(8) constraint crm_customer_active_cc
                                   check (active in ('ACTIVE','INACTIVE')),
    creation_date                  date not null,
    modification_date              date,
    dob                            date not null,
    ssn                            varchar2(15),
    address                        varchar2(35) not null,
    state                          varchar2(5),
    city                           varchar2(25),
    country                        varchar2(5),
    postal_code                    varchar2(15) not null,
    cc_card                        number,
    cc_pin                         number,
    cc_expire                      date
)
;

Prompt Inserting 389 rows
commit;

Prompt Should return 389 rows inserted
select count(*) from crm_customer;
